contracts/TcbsToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "./ERC20.sol";

contract TCBSToken is ERC20 {
    constructor() {
        // Mint 100 tokens to msg.sender
        // Similar to how
        // 1 dollar = 100 cents
        // 1 token = 1 * (10 ** decimals)
        mint(msg.sender, 100 * 10**uint(decimals()));
    }
}

